import React from 'react';
import "./Header.css";
import {HeaderLeft} from '../../images/top-left.PNG';

const Header = () => {
  return (
    <div className='row header'>
        <div className='col-md-2'>
            <img src={HeaderLeft} className='img-fluid' alt='header-left' />
        </div>
        <div className='col-md-8'>
            <h6 className='text-uppercase'>seal ... shield ... feel</h6>
        </div>
        <div className='col-md-2'></div>
    </div>
  )
}

export default Header;
